export async function fetchApi(amount: number, difficulty: Difficulty) {
    let url = `https://opentdb.com/api.php?amount=${amount}^&category=9&difficulty=${difficulty}&type=multiple`
    let data = await (await fetch(url)).json()
    console.log(data);
}

export enum Difficulty {
    Easy = "easy",
    Medium = "medium",
    hard = "hard",
}

export type Question = {
    category: string;
    correct_answer: string;
    difficulty: string;
    incorrect_answers: string[];
    question: string;
    type: string;
};
export type QuestionState = Question & {
    answer: string[]
};
